use strict;
use integer;

my $a = "(1+x^24+3*x^32+3*x^40+6*x^48+8*x^56+12*x^64+18*x^72+25*x^80+29*x^88+40*x^96+50*x^104+58*x^112+69*x^120+80*x^128+85*x^136+96*x^144+104*x^152+107*x^160+109*x^168+112*x^176+109*x^184+107*x^192+104*x^200+96*x^208+85*x^216+80*x^224+69*x^232+58*x^240+50*x^248+40*x^256+29*x^264+25*x^272+18*x^280+12*x^288+8*x^296+6*x^304+3*x^312+3*x^320+x^328+x^352)/((1-x^8)^2*(1-x^24)^4*(1-x^40)^2*(1+x^8+2*x^24+2*x^32+x^40+4*x^48+2*x^56+x^64+5*x^72+2*x^80+2*x^88+5*x^96+x^104+2*x^112+4*x^120+x^128+2*x^136+2*x^144+x^160+x^168))";
my $b = "(1+x^ 3+3*x^ 4+3*x^ 5+6*x^6 +8*x^7 +12*x^8 +18*x^9 +25*x^10+29*x^11+40*x^12+50*x^13 +58*x^14 +69*x^15 +80*x^16 +85*x^17 +96*x^18 +104*x^19 +107*x^20 +109*x^21 +112*x^22 +109*x^23 +107*x^24 +104*x^25 +96*x^26 +85*x^27 +80*x^28 +69*x^29 +58*x^30 +50*x^31 +40*x^32 +29*x^33 +25*x^34 +18*x^35 +12*x^36 +8*x^37 +6*x^38 +3*x^39 +3*x^40 +x^41 +x^44) /((1-x^1)^2*(1-x^3 )^4*(1-x^5 )^2*(1+x^1+2*x^3 +2*x^4 +x^5 +4*x^6 +2*x^7 +x^8 +5*x^9 +2*x^10+2*x^11+5*x^12+x^13 +2*x^14 +4*x^15 +x^16 +2*x^17 +2*x^18 +x^20 +x^21 ))";
$a =~ s{\s}{}g;
$b =~ s{\s}{}g;
$b =~ s{x\^(\d+)}{"x\^" . (8*$1)}eg;
my @as = split(/x/, $a);
my @bs = split(/x/, $b);
for (my $ind = 0; $ind < scalar(@as); $ind ++) {
	if ($as[$ind] ne $bs[$ind]) {
		print "difference at $ind: $as[$ind] ne $bs[$ind] \n";
	}
} # for

